import { useAddTask } from '../../components';

const AddTaskPage = () => {
    const {
        priority, setPriority, dueDate, setDueDate, title, setTitle, description, setDescription, users, selectedUser, setSelectedUser, handleSubmit
    } = useAddTask();
};

export default AddTaskPage;
